import { Link } from "react-router-dom";
import EventsNavigation from "../components/EventsNavigation";

const DUMMY_EVENTS = [
    {   name: "Concert", id: "1"  },
    {   name: "Party", id: "2"  }
]; 

function EventsPage() {
    return <>
    <EventsNavigation />
    <h1>List of events</h1>
    <ul>
    {DUMMY_EVENTS.map(event => <li><Link to={event.id}>{event.name}</Link></li>)}
    </ul>
    </>;
  }
  
  export default EventsPage;
